import React, { useState } from "react";
import auth from "../../lib/api/auth";
import { DataTable, Button } from "react-native-paper";
import { View } from "react-native";
import AsyncStorage from "@react-native-async-storage/async-storage";
import { set } from "lodash";
import { useNavigation } from "@react-navigation/native";
import { useFonts, Inter_900Black } from "@expo-google-fonts/inter";
import { TextInput } from "react-native-paper";
import SelectDropdown from "react-native-select-dropdown";
import DatePicker from "react-native-datepicker";


export default function EditTable() {
  const [title, setTitle] = useState("");
  const [courtName, setCourtName] = useState("");
  const [notes, setNotes] = useState("");
  const [category, setCategory] = useState("");
  const [nextHiring, setHiring] = useState("");
  const [startingDate, setStartingData] = useState("");
  const [stage, setStage] = useState("");
  const navigation = useNavigation();
  console.log("title: ", title);
  const [date, setDate] = useState('');
  const AddNewCase = async () => {
    let id = await AsyncStorage.getItem("userId");
    const values = {
      id: JSON.parse(id),
      title: title,
      courtName: courtName,
      notes: notes,
      stage: stage,
      category: category,
      nextHiring: nextHiring,
      startingDate: startingDate,
    };
    const res = await auth.post("lawyer/addCase", values);
    navigation.goBack();
    console.log(res.status);
  };
  const cat = [
    "Corporate law",
    "Taxation Law",
    "Criminal law",
    "Civil law",
    "Family law",
    "Real estate",
    "Rent law",
    "Intellectual property",
    "Banking law",
    "Medical law",
    "Tax law",
    "Business law",
    "Immigration ",
    "Constitution law",
    "Employment & Labour Law",
    "International Law",
    "Environment Law",
    "Human rights",
    "Consumer protection",
    "Harassment",
    "Cyber Crime",
    "Defamation ",
    "Arbitration Law",
    "Commercial Law",
    "Construction Law"

  ];
  const stg = ["Open", "Fixed", "Closed"];

  return (
    <>
      <View>
        <DataTable.Row style={{}}>
          <DataTable.Cell style={{}}></DataTable.Cell>
          <DataTable.Cell style={{}}>
            <View>
              <TextInput
                onChangeText={(text) => setTitle(text)}
                style={{
                  backgroundColor: "#EEEEEE",

                  height: 40,

                  paddingLeft: 15,
                  color: "#222222",

                  fontSize: 15,
                  fontWeight: "500",
                  letterSpacing: 1,
                }}
                placeholder="CaseTitle"
              />
            </View>
          </DataTable.Cell>
          <DataTable.Cell style={{}}>
            <View>
              <TextInput
                onChangeText={(text) => setCourtName(text)}
                style={{
                  backgroundColor: "#EEEEEE",
                  //
                  height: 40,

                  paddingLeft: 15,
                  color: "#222222",

                  fontSize: 15,
                  fontWeight: "500",
                  letterSpacing: 1,
                }}
                placeholder="CourtName"
              />
            </View>
          </DataTable.Cell>
          <DataTable.Cell style={{}}>
            <View>
              
              <SelectDropdown
                data={cat}
                onSelect={(selectedItem, index) => {
                    setCategory(selectedItem);
                }}
                buttonStyle={{
                  margin: 10,
                  borderRadius: 36,
                }}
                defaultButtonText={"Corporate law"}
                // renderDropdownIcon={displayIcon}
                // dropdownIconPosition={'right'}
                buttonTextAfterSelection={(selectedItem, index) => {
                  // text represented after item is selected
                  // if data array is an array of objects then return selectedItem.property to render after item is selected
                  return selectedItem;
                }}
                rowTextForSelection={(item, index) => {
                  // text represented for each item in dropdown
                  // if data array is an array of objects then return item.property to represent item in dropdown
                  return item;
                }}
              />
            </View>
          </DataTable.Cell>
          <DataTable.Cell style={{}}>
            <View>
            <SelectDropdown
                data={stg}
                onSelect={(selectedItem, index) => {
                    setStage(selectedItem);
                }}
                buttonStyle={{
                  margin: 10,
                  borderRadius: 36,
                }}
                defaultButtonText={"Open"}
                // renderDropdownIcon={displayIcon}
                // dropdownIconPosition={'right'}
                buttonTextAfterSelection={(selectedItem, index) => {
                  // text represented after item is selected
                  // if data array is an array of objects then return selectedItem.property to render after item is selected
                  return selectedItem;
                }}
                rowTextForSelection={(item, index) => {
                  // text represented for each item in dropdown
                  // if data array is an array of objects then return item.property to represent item in dropdown
                  return item;
                }}
              />
            </View>
          </DataTable.Cell>
          <DataTable.Cell style={{}}>
            <View>
            <DatePicker
         
          //initial date from state
          mode="date" //The enum of date, datetime and time
          placeholder="select date"
          format="DD-MM-YYYY"
          minDate="01-01-2016"
          maxDate="01-01-2019"
          confirmBtnText="Confirm"
          cancelBtnText="Cancel"
          customStyles={{
            dateIcon: {
              display: 'none',
              position: 'absolute',
              left: 0,
              top: 4,
              marginLeft: 0,
            },
            dateInput: {
              marginLeft: 36,
            },
          }}
          onDateChange={(date) => {
            setHiring(date);
          }}
        />
            </View>
          </DataTable.Cell>
          <DataTable.Cell style={{}}>
            <View>
              <TextInput
                onChangeText={(text) => setHiring(text)}
                style={{
                  backgroundColor: "#EEEEEE",

                  height: 40,

                  paddingLeft: 15,
                  color: "#222222",

                  fontSize: 15,
                  fontWeight: "500",
                  letterSpacing: 1,
                }}
                placeholder="Next Date"
              />
            </View>
          </DataTable.Cell>
          <DataTable.Cell style={{}}>
            <View>
              <TextInput
                onChangeText={(text) => setNotes(text)}
                style={{
                  backgroundColor: "#EEEEEE",

                  height: 40,

                  paddingLeft: 15,
                  color: "#222222",

                  fontSize: 15,
                  fontWeight: "500",
                  letterSpacing: 1,
                }}
                placeholder="Notes"
              />
            </View>
          </DataTable.Cell>
        </DataTable.Row>
        <View>
          <Button
            onPress={() => AddNewCase()}
            color="#244e78"
            style={{
              width: "20%",
              borderColor: "#244e78",
              borderWidth: 1,
              margin: 5,
              padding: 5,
              left: "50%",
            }}
          >
            Submit
          </Button>
        </View>
      </View>
    </>
  );
}
